29.body:
You can run the request in the background and receive events with the second param set to true. import { Website } from "@spider-rs/spider-rs"; const website = new Website("https://rsseau.fr"); const onPageEvent = (err, value) => { console.log(value);
}; await website.crawl(onPageEvent, true);
// this will run instantly as the crawl is in the background

30.body:
You can setup many subscriptions to run events when a crawl happens. import { Website } from "@spider-rs/spider-rs"; const website = new Website("https://rsseau.fr"); const onPageEvent = (err, value) => { console.log(value);
}; const subscriptionID = website.subscribe(onPageEvent); await website.crawl(onPageEvent); website.unsubscribe(subscriptionID);
// this will run instantly as the crawl is in the background

31.body:
Scape a website and collect the resource data. import { Website } from "@spider-rs/spider-rs"; // pass in the website url
const website = new Website("https://rsseau.fr"); await website.scrape(); // [ { url: "https://rsseau.fr/blog", html: "<html>...</html>"}, ...]
console.log(website.getPages());

32.body:
Use a cron job that can run any time of day to gather website data. import { Website } from "@spider-rs/spider-rs"; const website = new Website("https://choosealicense.com") .withCron("1/5 * * * * *") .build(); // get the pages of the website when the cron runs streamed.
const onPageEvent = (err, value) => { console.log(value);
}; const handle = await website.runCron(onPageEvent);

